import React from "react";
import PropTypes from "prop-types";

export default function Navbar({ title, icon }) {
  return (
    <div className="navbar bg-info">
      <h1>
        <i className={icon}>{title}</i>
      </h1>
    </div>
  );
}

Navbar.defaultProps = {
  title: "Contact Keeper",
  icon: "far fa-address-card",
};
